INSERT INTO `configuration` (`configuration_id`, `configuration_title`, `configuration_key`, `configuration_value`, `configuration_description`, `configuration_group_id`, `sort_order`, `last_modified`, `date_added`, `use_function`, `set_function`) VALUES (1, 'Store Name', 'STORE_NAME', 'QuizStuff', 'The name of my store', 1, 1, NULL, '2010-11-02 23:52:16', NULL, NULL),
(2, 'Store Owner', 'STORE_OWNER', 'William L Horning', 'The name of my store owner', 1, 2, NULL, '2010-11-02 23:52:16', NULL, NULL),
(3, 'Country', 'STORE_COUNTRY', '223', 'The country my store is located in <br /><br /><strong>Note: Please remember to update the store zone.</strong>', 1, 6, NULL, '2010-11-02 23:52:16', 'zen_get_country_name', 'zen_cfg_pull_down_country_list('),
(4, 'Zone', 'STORE_ZONE', '23', 'The zone my store is located in', 1, 7, NULL, '2010-11-02 23:52:16', 'zen_cfg_get_zone_name', 'zen_cfg_pull_down_zone_list('),
(5, 'Expected Sort Order', 'EXPECTED_PRODUCTS_SORT', 'desc', 'This is the sort order used in the expected products box.', 1, 8, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''asc'', ''desc''), '),
(6, 'Expected Sort Field', 'EXPECTED_PRODUCTS_FIELD', 'date_expected', 'The column to sort by in the expected products box.', 1, 9, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''products_name'', ''date_expected''), '),
(7, 'Switch To Default Language Currency', 'USE_DEFAULT_LANGUAGE_CURRENCY', 'false', 'Automatically switch to the language''s currency when it is changed', 1, 10, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''true'', ''false''), '),
(8, 'Language Selector', 'LANGUAGE_DEFAULT_SELECTOR', 'Default', 'Should the default language be based on the Store preferences, or the customer''s browser settings?<br /><br />Default: Store''s default settings', 1, 11, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''Default'', ''Browser''), '),
(9, 'Use Search-Engine Safe URLs (still in development)', 'SEARCH_ENGINE_FRIENDLY_URLS', 'false', 'Use search-engine safe urls for all site links', 6, 12, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''true'', ''false''), '),
(10, 'Display Cart After Adding Product', 'DISPLAY_CART', 'true', 'Display the shopping cart after adding a product (or return back to their origin)', 1, 14, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''true'', ''false''), '),
(11, 'Default Search Operator', 'ADVANCED_SEARCH_DEFAULT_OPERATOR', 'and', 'Default search operators', 1, 17, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''and'', ''or''), '),
(12, 'Store Address and Phone', 'STORE_NAME_ADDRESS', 'Mail to: William L Horning\r\n816 Aspen Dr.\r\nManteno, IL 60950-5007\r\nPlease make out check to: William L Horning\r\nemail:quizstuff@quizstuff.com (to make phone contact a response will be made)', 'This is the Store Name, Address and Phone used on printable documents and displayed online', 1, 18, '2024-08-05 10:48:11', '2010-11-02 23:52:16', NULL, 'zen_cfg_textarea('),
(13, 'Show Category Counts', 'SHOW_COUNTS', 'true', 'Count recursively how many products are in each category', 1, 19, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''true'', ''false''), '),
(14, 'Tax Decimal Places', 'TAX_DECIMAL_PLACES', '0', 'Pad the tax value this amount of decimal places', 1, 20, NULL, '2010-11-02 23:52:16', NULL, NULL),
(15, 'Display Prices with Tax', 'DISPLAY_PRICE_WITH_TAX', 'false', 'Display prices with tax included (true) or add the tax at the end (false)', 1, 21, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''true'', ''false''), '),
(16, 'Display Prices with Tax in Admin', 'DISPLAY_PRICE_WITH_TAX_ADMIN', 'false', 'Display prices with tax included (true) or add the tax at the end (false) in Admin(Invoices)', 1, 21, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''true'', ''false''), '),
(17, 'Basis of Product Tax', 'STORE_PRODUCT_TAX_BASIS', 'Shipping', 'On what basis is Product Tax calculated. Options are<br />Shipping - Based on customers Shipping Address<br />Billing Based on customers Billing address<br />Store - Based on Store address if Billing/Shipping Zone equals Store zone', 1, 21, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''Shipping'', ''Billing'', ''Store''), '),
(18, 'Basis of Shipping Tax', 'STORE_SHIPPING_TAX_BASIS', 'Shipping', 'On what basis is Shipping Tax calculated. Options are<br />Shipping - Based on customers Shipping Address<br />Billing Based on customers Billing address<br />Store - Based on Store address if Billing/Shipping Zone equals Store zone - Can be overriden by correctly written Shipping Module', 1, 21, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''Shipping'', ''Billing'', ''Store''), '),
(19, 'Sales Tax Display Status', 'STORE_TAX_DISPLAY_STATUS', '0', 'Always show Sales Tax even when amount is $0.00?<br />0= Off<br />1= On', 1, 21, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''0'', ''1''), '),
(20, 'Show Split Tax Lines', 'SHOW_SPLIT_TAX_CHECKOUT', 'false', 'If multiple tax rates apply, show each rate as a separate line at checkout', 1, 22, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''true'', ''false''), '),
(21, 'Admin Session Time Out in Seconds', 'SESSION_TIMEOUT_ADMIN', '3600', 'Enter the time in seconds. Default=3600<br />Example: 3600= 1 hour<br /><br />Note: Too few seconds can result in timeout issues when adding/editing products', 1, 40, NULL, '2010-11-02 23:52:16', NULL, NULL),
(22, 'Admin Set max_execution_time for processes', 'GLOBAL_SET_TIME_LIMIT', '60', 'Enter the time in seconds for how long the max_execution_time of processes should be. Default=60<br />Example: 60= 1 minute<br /><br />Note: Changing the time limit is only needed if you are having problems with the execution time of a process', 1, 42, NULL, '2010-11-02 23:52:16', NULL, NULL),
