(24, 'Store Status', 'STORE_STATUS', '0', 'What is your Store Status<br />0= Normal Store<br />1= Showcase no prices<br />2= Showcase with prices', 1, 25, '2011-01-12 12:13:54', '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''0'', ''1'', ''2''), '),
