(407, 'Column Width - Right', 'COLUMN_WIDTH_RIGHT', '50px', 'Width of the Right Column<br />px may be included<br />Default = 150px', 19, 21, '2010-11-18 13:15:12', '2003-11-21 22:16:36', NULL, NULL),
(408, 'Categories Separator between links Status', 'SHOW_CATEGORIES_SEPARATOR_LINK', '1', 'Show Category Separator between Category Names and Links?<br />0= off<br />1= on', 19, 24, NULL, '2010-11-02 23:52:16', NULL, 'zen_cfg_select_option(array(''0'', ''1''), '),
(409, 'Categories Separator between the Category Name and Count', 'CATEGORIES_SEPARATOR', '-&gt;', 'What separator do you want between the Category name and the count?<br />Default = -&amp;gt;', 19, 25, NULL, '2003-11-21 22:16:36', NULL, 'zen_cfg_textarea_small('),
(410, 'Categories Separator between the Category Name and Sub Categories', 'CATEGORIES_SEPARATOR_SUBS', '|_&nbsp;', 'What separator do you want between the Category name and Sub Category Name?<br />Default = |_&amp;nbsp;', 19, 26, NULL, '2004-03-25 22:16:36', NULL, 'zen_cfg_textarea_small('),
