(534, 'EZ-Pages Pages to disable headers', 'EZPAGES_DISABLE_HEADER_DISPLAY_LIST', '', 'EZ-Pages "pages" on which to NOT display the normal "header" for your site.<br />Simply list page ID numbers separated by commas with no spaces.<br />Page ID numbers can be obtained from the EZ-Pages screen under Admin->Tools.<br />ie: 1,5,2<br />or leave blank.', 30, 40, NULL, '2010-11-02 23:52:17', NULL, 'zen_cfg_textarea_small('),
(535, 'EZ-Pages Pages to disable footers', 'EZPAGES_DISABLE_FOOTER_DISPLAY_LIST', '', 'EZ-Pages "pages" on which to NOT display the normal "footer" for your site.<br />Simply list page ID numbers separated by commas with no spaces.<br />Page ID numbers can be obtained from the EZ-Pages screen under Admin->Tools.<br />ie: 3,7<br />or leave blank.', 30, 41, NULL, '2010-11-02 23:52:17', NULL, 'zen_cfg_textarea_small('),
(536, 'EZ-Pages Pages to disable left-column', 'EZPAGES_DISABLE_LEFTCOLUMN_DISPLAY_LIST', '', 'EZ-Pages "pages" on which to NOT display the normal "left" column (of sideboxes) for your site.<br />Simply list page ID numbers separated by commas with no spaces.<br />Page ID numbers can be obtained from the EZ-Pages screen under Admin->Tools.<br />ie: 21<br />or leave blank.', 30, 42, NULL, '2010-11-02 23:52:17', NULL, 'zen_cfg_textarea_small('),
(537, 'EZ-Pages Pages to disable right-column', 'EZPAGES_DISABLE_RIGHTCOLUMN_DISPLAY_LIST', '', 'EZ-Pages "pages" on which to NOT display the normal "right" column (of sideboxes) for your site.<br />Simply list page ID numbers separated by commas with no spaces.<br />Page ID numbers can be obtained from the EZ-Pages screen under Admin->Tools.<br />ie: 3,82,13<br />or leave blank.', 30, 43, NULL, '2010-11-02 23:52:17', NULL, 'zen_cfg_textarea_small('),
(538, 'Use root path for cookie path', 'SESSION_USE_ROOT_COOKIE_PATH', 'False', 'Normally Zen Cart will use the directory that a store resides in as the cookie path. This can cause problems with some servers. This setting allows you to set the cookie path to the root of the server, rather than the store directory. It should only be used if you have problems with sessions. <strong>Default Value = False</strong><br /><br /><strong>Changing this setting may mean you have problems logging into your admin, you should clear your browser cookies to overcome this.</strong>', 15, 999, NULL, '0001-01-01 00:00:00', NULL, 'zen_cfg_select_option(array(''True'', ''False''), '),
(539, 'Add period prefix to cookie domain', 'SESSION_ADD_PERIOD_PREFIX', 'True', 'Normally Zen Cart will add a period prefix to the cookie domain, e.g.  .www.mydomain.com. This can sometimes cause problems with some server configurations. If you are having session problems you may want to try setting this to False. <strong>Default Value = True</strong>', 15, 999, NULL, '0001-01-01 00:00:00', NULL, 'zen_cfg_select_option(array(''True'', ''False''), '),
(590, 'Enable USPS Shipping', 'MODULE_SHIPPING_USPS_STATUS', 'True', 'Do you want to offer USPS shipping?', 6, 0, NULL, '2018-09-18 13:40:41', NULL, 'zen_cfg_select_option(array(''True'', ''False''), '),
(591, 'Enter the USPS Web Tools User ID', 'MODULE_SHIPPING_USPS_USERID', '321QUIZS2246', 'Enter the USPS USERID assigned to you for Rate Quotes/ShippingAPI.', 6, 0, NULL, '2018-09-18 13:40:41', NULL, NULL),
(592, 'Which server to use', 'MODULE_SHIPPING_USPS_SERVER', 'production', 'An account at USPS is needed to use the Production server', 6, 0, NULL, '2018-09-18 13:40:41', NULL, 'zen_cfg_select_option(array(''test'', ''production''), '),
(593, 'All Packages are Machinable', 'MODULE_SHIPPING_USPS_MACHINABLE', 'False', 'Are all products shipped machinable based on C700 Package Services 2.0 Nonmachinable PARCEL POST USPS Rules and Regulations?<br /><br /><strong>Note: Nonmachinable packages will usually result in a higher Parcel Post Rate Charge.<br /><br />Packages 35lbs or more, or less than 6 ounces (.375), will be overridden and set to False</strong>', 6, 0, NULL, '2018-09-18 13:40:41', NULL, 'zen_cfg_select_option(array(''True'', ''False''), '),
(594, 'Handling Fee', 'MODULE_SHIPPING_USPS_HANDLING', '0', 'Handling fee for this shipping method.', 6, 0, NULL, '2018-09-18 13:40:41', NULL, NULL),
(595, 'Handling Per Order or Per Box', 'MODULE_SHIPPING_USPS_HANDLING_METHOD', 'Order', 'Do you want to charge Handling Fee Per Order or Per Box?', 6, 0, NULL, '2018-09-18 13:40:41', NULL, 'zen_cfg_select_option(array(''Order'', ''Box''), '),
(596, 'Tax Class', 'MODULE_SHIPPING_USPS_TAX_CLASS', '0', 'Use the following tax class on the shipping fee.', 6, 0, NULL, '2018-09-18 13:40:41', 'zen_get_tax_class_title', 'zen_cfg_pull_down_tax_classes('),
(597, 'Tax Basis', 'MODULE_SHIPPING_USPS_TAX_BASIS', 'Shipping', 'On what basis is Shipping Tax calculated. Options are<br />Shipping - Based on customers Shipping Address<br />Billing Based on customers Billing address<br />Store - Based on Store address if Billing/Shipping Zone equals Store zone', 6, 0, NULL, '2018-09-18 13:40:41', NULL, 'zen_cfg_select_option(array(''Shipping'', ''Billing'', ''Store''), '),
(598, 'Shipping Zone', 'MODULE_SHIPPING_USPS_ZONE', '0', 'If a zone is selected, only enable this shipping method for that zone.', 6, 0, NULL, '2018-09-18 13:40:41', 'zen_get_zone_class_title', 'zen_cfg_pull_down_zone_classes('),
(599, 'Sort Order', 'MODULE_SHIPPING_USPS_SORT_ORDER', '0', 'Sort order of display.', 6, 0, NULL, '2018-09-18 13:40:41', NULL, NULL),
(600, 'Domestic Shipping Methods', 'MODULE_SHIPPING_USPS_TYPES', 'PRIORITY', 'Select the domestic services to be offered:', 6, 14, NULL, '2018-09-18 13:40:41', NULL, 'zen_cfg_select_multioption(array(''EXPRESS'', ''PRIORITY'', ''FIRST CLASS'', ''PARCEL'', ''MEDIA'', ''BPM'', ''LIBRARY''), '),
(601, 'International Shipping Methods', 'MODULE_SHIPPING_USPS_TYPES_INTL', 'Global Express, Global Express Non-Doc Rect, Global Express Non-Doc Non-Rect, Global Express Envelopes, Express Mail Int, Express Mail Int Flat Rate Env, Priority Mail International, Priority Mail Int Flat Rate Env, Priority Mail Int Flat Rate Small Box, Priority Mail Int Flat Rate Med Box, Priority Mail Int Flat Rate Lrg Box, First Class Mail Int Lrg Env, First Class Mail Int Package, First Class Mail Int Letter', 'Select the international services to be offered:', 6, 15, NULL, '2018-09-18 13:40:41', NULL, 'zen_cfg_select_multioption(array(''Global Express'', ''Global Express Non-Doc Rect'', ''Global Express Non-Doc Non-Rect'', ''Global Express Envelopes'', ''Express Mail Int'', ''Express Mail Int Flat Rate Env'', ''Priority Mail International'', ''Priority Mail Int Flat Rate Env'', ''Priority Mail Int Flat Rate Small Box'', ''Priority Mail Int Flat Rate Med Box'', ''Priority Mail Int Flat Rate Lrg Box'', ''First Class Mail Int Lrg Env'', ''First Class Mail Int Package'', ''First Class Mail Int Letter''), '),
(602, 'USPS Options', 'MODULE_SHIPPING_USPS_OPTIONS', 'Display weight, Display transit time', 'Select from the following the USPS options.', 6, 16, NULL, '2018-09-18 13:40:41', NULL, 'zen_cfg_select_multioption(array(''Display weight'', ''Display transit time''), '),
(603, 'Debug Mode', 'MODULE_SHIPPING_USPS_DEBUG_MODE', 'Off', 'Would you like to enable debug mode?  A complete detailed log of USPS quote results may be emailed to the store owner.', 6, 0, NULL, '2018-09-18 13:40:41', NULL, 'zen_cfg_select_option(array(''Off'', ''Email''), ');
