INSERT INTO `orders_status_history` (`orders_status_history_id`, `orders_id`, `orders_status_id`, `date_added`, `customer_notified`, `comments`) VALUES (1, 1, 2, '2008-09-18 12:18:38', 1, 'This is for Global NYI placing an order for some Bible Quizzing Equipment. Can you please help me with the financial portion of this request? We would like to pay for the equipment -- $120 USD -- out of H100 APR1102 and transfer it to H200 APR1096?'),
