(16, 2, 6, '0000-00-00 00:00:00', 1, 'Thank you for your payment! We should be able to ship your computer with upgraded memory installed out tomorrow and it will be preloaded with QuizMachine and a lifetime upgrade registration code. The interface box is still on backorder but we will notify you once it has been shipped.'),
(17, 6, 2, '0000-00-00 00:00:00', 1, ''),
(18, 2, 1, '0000-00-00 00:00:00', 1, 'The interface box is still on backorder. You will be updated as to when the box will ship when the box is made for your order. The QuizStuff Staff'),
(19, 2, 5, '0000-00-00 00:00:00', 1, 'Your order has shipped excluding the Parallel Port Interface Box which is on backorder. QuizMachine and the registration code have been pre-loaded and are ready to use. The registration code file is located on the desktop for future use (such as if you should change computers and need to reload the software). Please keep the code in a place where you can find it easily. Thank you for your order. You can track the package online at: http://trkcnfrm1.smi.usps.com/PTSInternetWeb/InterLabelInquiry.do?origTrackNum=9105150134711389149307 Please note: Tracking information is updated throughout the day but most data is transmitted in the afternoon or evening. For example if you mailed your Express Mail package at 10:00 a.m. you might not be able to view tracking information until the next day'),
(20, 6, 1, '0000-00-00 00:00:00', 1, 'Your order has been received. When payment is received a registration code will be sent to you by email. If you need the software and user manual please download both from www.quizstuff.com from the Downloads tab. Thank you The QuizStuff Staff'),
(21, 2, 7, '0000-00-00 00:00:00', 0, ''),
