(1056, 138, 21, '2011-04-03 23:13:11', 0, 'Pad #1 on the red string not working.\r\n\r\n\r\nName: Scott Henderson \r\nEmail: palanthor@comcast.net \r\nMessage: we received our new jump seats in early jan. and discovered at this last quiz meet that the red string seat number 1 is not working. I need to know what to do to get these seats repaired. \r\n\r\nAnswer:\r\nScott:\r\n\r\nGood evening.  I am sorry to hear that one of your pads is not working properly.\r\nI hope the others are working OK.  If you want and have the time, I can look at\r\nall of the strings to make sure everything is OK.  \r\n\r\nThe first option would be to send the string back to me at this address:\r\n\r\nBill Horning\r\n816 Aspen Dr.\r\nManteno, IL 60950-5007\r\n\r\nand I will make any fix necessary.  I would then send it back to you ASAP.\r\n\r\nThe only other option would be to give the string to someone coming to RCL next month\r\n(that is if you don''t need them right away) and I can fix them and have that person\r\nreturn it to you.\r\n\r\nWhatever you decide is OK with me.\r\n\r\nBill Horning\r\nQuizStuff'),
