INSERT INTO `products_description` (`products_id`, `language_id`, `products_name`, `products_description`, `products_url`, `products_viewed`) VALUES (234, 1, 'Dell Laptop', '<div style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;">Included:</div><div style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;"><ul><li>An i Processor</li><li>At least 4Gb memory (RAM)</li><li>At least 100gb hard drive or SDD</li><li>Monitor port (VGA and possible HDMI)</li><li>At least 2 USB ports</li><li>1 Ethernet (network) port</li><li>Possible CDRW optical drive (some DVDRW)</li><li>Software</li><li><span class="Apple-tab-span" style="white-space: pre;">&nbsp;</span>Windows 10 pro</li><li>Optional</li><li><span class="Apple-tab-span" style="white-space: pre;">&nbsp;</span>QuizMachine software including Lifetime Upgrade</li><li> Pads (up to 3 strings,, red, blue and green)</li><li> Interface Box (USB only)</li></ul></div>', '', 282),
(224, 1, 'QuizMachine (one user registration)', '<span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;">The software called QuizMachine used in Nazarene style bible quizzing. Detects which person jumps, keeps score, records all options for the rounds.</span><div><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;"></span><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;"><br /></span><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;">Scores can be exported to QMServer (included) to tally overall quiz stats.</span><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;"><br /></span><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;"><br /></span><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;">Scoresheets can be printed.</span>\r\n\r\n</div><div><font class="Apple-style-span" face="verdana, arial, helvetica, sans-serif" size="3"><span class="Apple-style-span" style="font-size: 12px;"><br /></span></font></div><div><font class="Apple-style-span" face="verdana, arial, helvetica, sans-serif" size="3"><span class="Apple-style-span" style="font-size: 12px;">Includes Lifetime Upgrades</span></font></div>', '', 9752),
(225, 1, 'QuizMachine (DQD user registrations - 5)', '<div id="productDescription" class="productGeneral biggerText" style="padding: 0.5em; font-family: verdana, arial, helvetica, sans-serif;"><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;"><b><u>DISTRICT DIRECTORS ONLY!</u></b></span><div style="font-size: 1.2em;"><font class="Apple-style-span" face="verdana, arial, helvetica, sans-serif" size="3"><span class="Apple-style-span" style="font-size: 12px;"><b><u><br /></u></b></span></font></div><div><span class="Apple-style-span" style="font-size: 1.2em;"><b /></span><b><b><b><b><b><b><b><b><b><b><b><font class="Apple-style-span" face="verdana, arial, helvetica, sans-serif" size="3" style="font-size: 1.2em;"><span class="Apple-style-span" style="font-size: 12px;"><b>Purchase 5 registrations-<font color="#990033"><u>includes Lifetime Upgrades.</u></font></b></span></font></b></b></b></b></b></b></b></b></b></b></b></div><div><font color="#990033"><span style="font-size: 12px;"><b><u><br /></u></b></span></font><b><b><b><b><b><b><b><b><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;">The software called QuizMachine used in Nazarene style bible quizzing. Detects which person jumps, keeps score, records all options for the rounds.</span><div style="font-size: 1.2em;"><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;"></span><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;"><br /></span><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;">Scores can be exported to QMServer (included) to tally overall quiz stats.</span><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;"><br /></span><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;"><br /></span><span class="Apple-style-span" style="font-family: verdana, arial, helvetica, sans-serif; font-size: 12px;">Scoresheets can be printed.</span></div><div style="font-size: 1.2em;"><br /></div></b></b></b></b></b></b></b></b></div></div><b><b><b><b>&nbsp;</b>\r\n</b>\r\n</b>\r\n</b>', '', 2843),
(221, 1, 'USB Interface Box', 'USB Interface Box connects up to 3 strings of pads to a computer..laptop or desktop.<div><br /></div><div>Use QuizMachine software on Microsoft operating systems. Windows 7,8,10 all versions only.</div><div><br /></div><div>No power cord required. Power is supplied via the USB port on the computer.</div>', '', 4422),
(222, 1, 'Pads - 5 pads per string', '<div><span style="font-family: tahoma, arial, helvetica, sans-serif;">NOTICE: Pads are being made as quickly as possible (within a 4-6 weeks provided parts are available) as another person is helping. Please contact me for more information.</span></div><div><span style="font-family: tahoma, arial, helvetica, sans-serif;"><br /></span></div><div><span style="font-family: tahoma, arial, helvetica, sans-serif;">Pads - strings of 5 pads. Colors: Red, Blue (old yellow) and Green.</span></div><div><font class="Apple-style-span" face="tahoma, arial, helvetica, sans-serif"><br /></font><div><font class="Apple-style-span" face="tahoma, arial, helvetica, sans-serif"><b>Please specify the color(s) below</b>!\r\n</font></div><div><font class="Apple-style-span" face="tahoma, arial, helvetica, sans-serif"><br /></font></div><div><font class="Apple-style-span" face="tahoma, arial, helvetica, sans-serif">These are intended to work with QuizMachine and either the USB or Parallel port interface boxes from QuizStuff, but we cannot necessarily guarantee the strings to work with other quiz equipment.</font><span class="Apple-style-span" style="font-family: tahoma, arial, helvetica, sans-serif;">Use with other equipment at your own risk.\r\n</span></div><div><span class="Apple-style-span" style="font-family: tahoma, arial, helvetica, sans-serif;"><br /></span></div><div><span class="Apple-style-span" style="font-family: tahoma, arial, helvetica, sans-serif;">Made with Naugahyde leather and all sides sewn together professionally.</span></div><div><div>&nbsp;</div><div><font class="Apple-style-span" face="verdana, arial, helvetica, sans-serif"><span class="Apple-style-span" style="font-size: 12px;"><br /></span></font></div>\r\n</div></div>', '', 6310);
